/* General Styles */
body {
  font-family: 'Poppins', sans-serif;
  margin: 0;
  padding: 0;
  background-color: #f0f8ff; /* Light background */
}

/* Navbar */
.navbar {
  background-color: #ff6f61; /* Vivid red-orange */
  padding: 1rem;
}

.navbar-light .navbar-nav .nav-link {
  color: #fff;
  padding: 0.5rem 1rem;
  text-decoration: none;
  font-weight: bold;
  transition: color 0.3s ease;
}

.navbar-light .navbar-nav .nav-link:hover {
  color: #ffeb3b; /* Bright yellow on hover */
}

/* Page Content */
.page-content-wrapper {
  padding: 2rem;
  background-color: #e1bee7; /* Soft purple */
  color: #333;
}

/* Breadcrumbs */
.page-breadcrumbs {
  background-color: #ffeb3b; /* Bright yellow */
  padding: 10px;
  border-radius: 5px;
  font-weight: bold;
  color: #333;
}

/* Main Section */
main {
  background-color: #81c784; /* Light green */
  padding: 2rem;
  border-radius: 10px;
  box-shadow: 0px 4px 6px rgba(0, 0, 0, 0.1);
}

.container.my-4 {
  background-color: #ffccbc; /* Soft orange */
  padding: 20px;
  border-radius: 8px;
}

/* Footer */
footer {
  background-color: #64b5f6; /* Light blue */
  padding: 1.5rem;
  text-align: center;
  color: white;
  font-size: 1.2rem;
}

/* Symbols and Icon Elements */
#all-symbols {
  display: none;
}

/* Buttons */
button {
  background-color: #ff6f61; /* Vivid red-orange */
  border: none;
  color: white;
  padding: 10px 20px;
  border-radius: 5px;
  cursor: pointer;
  transition: background-color 0.3s ease;
}

button:hover {
  background-color: #ffeb3b; /* Bright yellow */
  color: #333;
}

/* Datepicker container */
.datepickers-container {
  background-color: #fff3e0; /* Light peach */
  padding: 20px;
  border-radius: 10px;
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
}

